import React, { useState } from "react";
import axios from "axios";
import { motion } from "framer-motion";
import "sweetalert2/dist/sweetalert2.min.css";
import SweetAlert from "./sweetalert";
import Cover from "./cover";

const App = () => {
  const [state, setState] = useState({
    age: 40,
    hypertension: 0,
    heart_disease: 0,
    avg_glucose_level: 83.94,
    bmi: 28.89
  });
  const [action, setAction] = useState('');

  const handlePredict = async () => {
    const response = await fetch('http://127.0.0.1:5000/predict', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ state: Object.values(state) }),
    });
    const data = await response.json();
    setAction(data.action);
  };

  return (
    <div className="container mx-auto p-4 flex flex-col justify-center items-center text-white h-screen">
      <Cover />
      <h1 className="text-4xl font-bold mb-3 text-center">
      Healthcare Action Predictor
      </h1>
      <p className="text-sm md:text-lg font-normal md:font-medium mb-8 text-center">
        Entrez un texte.
      </p>
      <div>
        <label>Age: </label>
        <input
          type="number"
          value={state.age}
          onChange={(e) => setState({ ...state, age: e.target.value })}
        />
      </div>
      <div>
        <label>Hypertension: </label>
        <input
          type="number"
          value={state.hypertension}
          onChange={(e) => setState({ ...state, hypertension: e.target.value })}
        />
      </div>
      <div>
        <label>Heart Disease: </label>
        <input
          type="number"
          value={state.heart_disease}
          onChange={(e) => setState({ ...state, heart_disease: e.target.value })}
        />
      </div>
      <div>
        <label>Average Glucose Level: </label>
        <input
          type="number"
          value={state.avg_glucose_level}
          onChange={(e) => setState({ ...state, avg_glucose_level: e.target.value })}
        />
      </div>
      <div>
        <label>BMI: </label>
        <input
          type="number"
          value={state.bmi}
          onChange={(e) => setState({ ...state, bmi: e.target.value })}
        />
      </div>
      <button onClick={handlePredict}>Predict Action</button>
      {action && <h2>Recommended Action: {action}</h2>}
      <div className="flex flex-col md:flex-row justify-between mx-auto gap-4">
        <div className="mb-4">
          <label className="block mb-2 text-sm font-medium text-white">
            Entrer un texte :
          </label>
          <input
            type="text"
            value={text}
            onChange={handleTextChange}
            className="text-input text-black px-2 py-1 rounded border"
          />
        </div>
      </div>

      <motion.button
        whileHover={{ scale: 1.06 }}
        whileTap={{ scale: 0.95 }}
        onClick={handlePredict}
        className="bg-gray-500 text-white px-4 py-2 rounded mt-4 text-base"
      >
        Analyser le Sentiment
      </motion.button>

      {sentiment && (
        <SweetAlert sentiment={sentiment} />
      )}
      {error && (
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.6 }}
          className="text-red-400 py-4 text-base font-medium absolute bottom-24"
        >
          {error}
        </motion.div>
      )}
    </div>
  );
};

export default App;
